const root = document.getElementById('mail-block');
const income_btn = document.getElementById('open-income');


const LETTER_ON_PAGE = 15;


let last_id = -1;
let current_mail = 0;

let store = [];

// let current_mail = 


function getMail(){
    let mail = new Letter();
    last_id += 1;
    mail.id = last_id;

    fetch('https://randomuser.me/api/')
        .then(function(response){
            return response.json();
        })
        .then(function(data){
            // console.log(data);
            mail.sender = new Sender(
                capitilize(data.results[0].name.first) + ' ' + capitilize(data.results[0].name.last),
                data.results[0].email,
                data.results[0].picture.large
            )
            return fetch('https://api.adviceslip.com/advice');
        })
        .then(function(response){
            return response.json();
        })
        .then(function(data){
            mail.data =  data.slip.advice;
            mail.topic = mail.data;
            store.push(mail);
            addItem(mail);
        });
}

function addItem(data){
    let item = generateMail(data);
    item.classList.add('letter_new');

    // let tt = document.getElementById('container');
    // let item = document.createElement('div');
    // item.classList.add('item');
    // item.classList.add('item_new');
    // item.innerText = data;
    // item.innerHTML = '<div class="item item_new"></div>';
    if(current_mail === LETTER_ON_PAGE){
        root.lastChild.remove();
        current_mail -= 1;
    }
    current_mail += 1;
    root.insertAdjacentElement('afterbegin', item);
    setTimeout(function(){
       item.classList.remove('letter_new');
    }, 50);
}


function capitilize(st){
    return st.charAt(0).toUpperCase() + st.slice(1);
}







class Sender{
    constructor(name, email, avatar){
        this.name = name;
        this.email = email;
        this.avatar = avatar;
    }
}

class Letter{
    constructor(id, sender, topic, message, date, unread){
        this.id = id;
        this.sender = sender;
        this.topic = topic;
        this.message = message;
        // this.date = date ? date : getCurrentDate();

        if(!date){
            let today = new Date();
            
            let dd = String(today.getDate()).padStart(2, '0');
            let mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
            let yyyy = String(today.getFullYear() % 100).padStart(2, '0');
            
            this.date = dd + '.' + mm + '.' + yyyy;
        }else{
            this.date = date;
        }

        // this.date = Date.get;
        this.unread = unread ? unread : true;
    }
}


