function generateMail(letter){
    let item = document.createElement('div');
    // label class="letter letter_unread letter_with-message letter-block__letter" for="msg"
    // item.htmlFor = `msg${letter.id}`;
    item.classList.add('letter');
    item.classList.add('letter-block__letter');
    item.classList.add('letter_new-letter');
    // item.classList.add('letter_with-message');

    if(letter.unread){
        item.classList.add('letter_unread');
    }

    item.innerHTML = `
        <input class="letter-block__message-label" id="msg${letter.id}" type="checkbox">
        <div class="message letter-block__message">

            ${letter.data}

            <label class="message__close-box-wrapper" for="msg${letter.id}">
                <div class="close-box message__close-box">
                    <div class="close-box__close"></div>
                </div>
            </label>
        </div>


        <label class="letter_with-message" for="msg${letter.id}">
            <div class="letter__checkbox-wrapper">
                <input id="check${letter.id}" class="checkbox letter__checkbox" type="checkbox">
            </div><div class="icon letter__icon">
                <div class="icon__char">${letter.sender.name[0].toUpperCase()}
                </div><div class="icon__image" style="background-image: url(${letter.sender.avatar});"></div>
            </div><div class="letter__sender">
                ${letter.sender.name}
            </div><div class="letter__unread-marker">
            </div><div class="letter__text">
                ${letter.topic}
            </div><div class="letter__date">
                ${letter.date}
            </div>
        </label>
    `;
    return item;
}



function prepareMail(){
    fetch('/data/mail.json')
        .then(function(response){
            return response.json();
        }).then(function(data){
            store = data;
            for(l of store){
                last_id = Math.max(last_id, parseInt(l.id, 10));
            }
            console.log(data);
            current_mail = store.length;
            root.append(...(store.map(generateMail).reverse()));
            //first set
            // global.store = store;
        });
}



prepareMail();
income_btn.onclick = getMail;
global.newMail = getMail;
const remove_button = document.getElementById('remove-btn');
// remove_button.

remove_button.onclick = function(){
    // console.log("wut");
    let tmp = [];
    for(l of store){
        let c = document.getElementById('check' + l.id);
        if(c && c.checked){
            let pp = c.parentNode.parentNode.parentNode;
            pp.classList.add('letter_remove');
            current_mail -= 1;
            // console.log("ww");
            setTimeout(function(){
                pp.remove();
                if(store.length > current_mail && current_mail < LETTER_ON_PAGE){
                    current_mail += 1;
                    console.log(store);
                    root.insertAdjacentElement('beforeend', generateMail(store[store.length - current_mail]));
                }
            //    pp.insertAdjacentElement('afterbegin', item);
            //    item.classList.remove('letter_new');
            }, 350);
        }else{
            tmp.push(l);
        }
    }
    store = tmp;
    setTimeout(function(){
        checkall.checked = false;
    }, 350);
}


const checkall = document.getElementById('checkall');
checkall.onchange = function(){
    let t = checkall.checked;
    for(l of store){
        if(l){
            let tt =  document.getElementById('check' + l.id);
            if(tt){
                tt.checked = t;
            }
            // document.getElementById('check' + l.id).checked = t;
        }
    }
}


